import React, { BrowserRouter, Route, Link } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
          <BrowserRouter>
      <Navbar />
      <Route path="/Home" component={Home} />
      <Route path="/book2" component={Book2} />
      <Route path="/newbook" component={NewBook} />
    </BrowserRouter>
    </div>
  );
}

export default App;
